func runSimpleChat() error {
	ctx, cancel := context.WithCancel(context.Background())
	defer cancel()

	sigCh := make(chan os.Signal, 1)
	signal.Notify(sigCh, syscall.SIGINT, syscall.SIGTERM)
	go func() {
		<-sigCh
		fmt.Println("\n\n Goodbye!")
		cancel()
		os.Exit(0)
	}()

	client := llm.NewClient(cfg.Ollama)

	fmt.Println(" Connecting to Ollama...")
	if err := client.CheckHealth(ctx); err != nil {
		return fmt.Errorf("failed to connect to Ollama: %w\nMake sure Ollama is running: ollama serve", err)
	}
	fmt.Printf(" Connected to Ollama (model: %s)\n\n", client.GetChatModel())

	messages := []llm.Message{
		{
			Role:    "system",
			Content: "You are CodeMentor, an intelligent code assistant. Help developers understand code and answer programming questions.",
		},
	}

	fmt.Println(" CodeMentor Chat (no RAG - use --path for code-aware chat)")
	fmt.Println("")

	scanner := bufio.NewScanner(os.Stdin)
	for {
		fmt.Print("\n You: ")
		if !scanner.Scan() {
			break
		}

		input := strings.TrimSpace(scanner.Text())
		if input == "" {
			continue
		}

		switch strings.ToLower(input) {
		case "exit", "quit":
			fmt.Println("\n Goodbye!")
			return nil
		case "clear":
			messages = messages[:1]
			fmt.Println("  Conversation cleared.")
			continue
		}

		messages = append(messages, llm.Message{Role: "user", Content: input})

		fmt.Print("\n CodeMentor: ")
		var response strings.Builder
		err := client.ChatStream(ctx, messages, func(content string, done bool) error {
			fmt.Print(content)
			response.WriteString(content)
			return nil
		})

		if err != nil {
			fmt.Printf("\n Error: %v\n", err)
			messages = messages[:len(messages)-1]
			continue
		}
		fmt.Println()

		messages = append(messages, llm.Message{Role: "assistant", Content: response.String()})
	}

	return scanner.Err()
}

