func (c *Chunker) ChunkByDelimiter(text, filePath, language string, delimiters []string) []*CodeChunk {
	// This is a simple implementation that could be enhanced
	// with language-specific regex patterns
	var chunks []*CodeChunk
	lines := strings.Split(text, "\n")

	var currentChunk strings.Builder
	startLine := 1
	currentLine := 1

	for _, line := range lines {
		isDelimiter := false
		for _, delim := range delimiters {
			if strings.Contains(line, delim) {
				isDelimiter = true
				break
			}
		}

		if isDelimiter && currentChunk.Len() > 0 {
			// Save current chunk
			content := currentChunk.String()
			if strings.TrimSpace(content) != "" {
				chunk := &CodeChunk{
					FilePath:  filePath,
					Language:  language,
					ChunkType: ChunkTypeGeneric,
					Name:      filePath,
					Content:   content,
					StartLine: startLine,
					EndLine:   currentLine - 1,
				}
				chunk.ID = generateChunkID(chunk)
				chunks = append(chunks, chunk)
			}

			// Start new chunk
			currentChunk.Reset()
			startLine = currentLine
		}

		currentChunk.WriteString(line)
		currentChunk.WriteString("\n")
		currentLine++
	}

	// Don't forget the last chunk
	if currentChunk.Len() > 0 {
		content := currentChunk.String()
		if strings.TrimSpace(content) != "" {
			chunk := &CodeChunk{
				FilePath:  filePath,
				Language:  language,
				ChunkType: ChunkTypeGeneric,
				Name:      filePath,
				Content:   content,
				StartLine: startLine,
				EndLine:   currentLine - 1,
			}
			chunk.ID = generateChunkID(chunk)
			chunks = append(chunks, chunk)
		}
	}

	return chunks
}

func (s *Server) handleHealth(c *gin.Context) {
	// Check Ollama connectivity
	ragAgent := agent.NewRAGAgent(s.config)
	defer ragAgent.Close()

	ctx, cancel := context.WithTimeout(c.Request.Context(), 5*time.Second)
	defer cancel()

	ollamaStatus := "ok"
	if err := ragAgent.CheckHealth(ctx); err != nil {
		ollamaStatus = fmt.Sprintf("error: %v", err)
	}

	c.JSON(http.StatusOK, gin.H{
		"status":  "ok",
		"version": "0.1.0",
		"ollama":  ollamaStatus,
	})
}

