func splitCamelCase(s string) []string {
	var result []string
	var current strings.Builder

	for i, r := range s {
		if i > 0 && (isUpper(byte(r)) || r == '_') {
			if current.Len() > 0 {
				result = append(result, current.String())
				current.Reset()
			}
			if r == '_' {
				continue
			}
		}
		current.WriteRune(r)
	}

	if current.Len() > 0 {
		result = append(result, current.String())
	}

	return result
}

