func (c *Client) Embed(ctx context.Context, text string) ([]float32, error) {
	req := EmbeddingRequest{
		Model:  c.embeddingModel,
		Prompt: text,
	}

	body, err := json.Marshal(req)
	if err != nil {
		return nil, fmt.Errorf("failed to marshal request: %w", err)
	}

	httpReq, err := http.NewRequestWithContext(ctx, "POST", c.host+"/api/embeddings", bytes.NewReader(body))
	if err != nil {
		return nil, fmt.Errorf("failed to create request: %w", err)
	}
	httpReq.Header.Set("Content-Type", "application/json")

	resp, err := c.httpClient.Do(httpReq)
	if err != nil {
		return nil, fmt.Errorf("failed to send request: %w", err)
	}
	defer resp.Body.Close()

	if resp.StatusCode != http.StatusOK {
		bodyBytes, _ := io.ReadAll(resp.Body)
		return nil, fmt.Errorf("ollama returned status %d: %s", resp.StatusCode, string(bodyBytes))
	}

	var embResp EmbeddingResponse
	if err := json.NewDecoder(resp.Body).Decode(&embResp); err != nil {
		return nil, fmt.Errorf("failed to decode response: %w", err)
	}

	return embResp.Embedding, nil
}

func (m *MemoryStore) Insert(chunks []*embedding.EmbeddedChunk) error {
	m.mu.Lock()
	defer m.mu.Unlock()

	for _, chunk := range chunks {
		m.chunks[chunk.Chunk.ID] = chunk
	}

	// Persist if dataPath is set
	if m.dataPath != "" {
		return m.save()
	}

	return nil
}

func (h *HybridRetriever) VectorSearch(ctx context.Context, query string, topK int) ([]*SearchResult, error) {
	queryEmbedding, err := h.embedder.EmbedChunks(ctx, []*indexer.CodeChunk{{Content: query}}, nil)
	if err != nil {
		return nil, err
	}

	return h.vectorStore.Search(queryEmbedding[0].Embedding, topK)
}

