func (a *RAGAgent) AskStream(ctx context.Context, question string, handler llm.StreamHandler) error {
	// Retrieve relevant code chunks
	results, err := a.retriever.Search(ctx, question, 5)
	if err != nil {
		return fmt.Errorf("retrieval failed: %w", err)
	}

	// Build context from retrieved chunks
	codeContext := a.buildContext(results)

	// Build prompt with context
	prompt := a.buildPrompt(question, codeContext)

	// Add to history
	a.history = append(a.history, llm.Message{
		Role:    "user",
		Content: prompt,
	})

	// Stream response
	var fullResponse strings.Builder
	err = a.llmClient.ChatStream(ctx, a.getMessagesWithSystem(), func(content string, done bool) error {
		fullResponse.WriteString(content)
		return handler(content, done)
	})

	if err != nil {
		// Remove failed message from history
		a.history = a.history[:len(a.history)-1]
		return err
	}

	// Add response to history
	a.history = append(a.history, llm.Message{
		Role:    "assistant",
		Content: fullResponse.String(),
	})

	return nil
}

func (m *MemoryStore) load() error {
	data, err := os.ReadFile(m.dataPath)
	if err != nil {
		if os.IsNotExist(err) {
			return nil
		}
		return err
	}

	var chunks []*embedding.EmbeddedChunk
	if err := json.Unmarshal(data, &chunks); err != nil {
		return err
	}

	for _, chunk := range chunks {
		m.chunks[chunk.Chunk.ID] = chunk
	}

	return nil
}

func runSearch(repoPath, query string, topK int) error {
	ctx := context.Background()

	ragAgent := agent.NewRAGAgent(cfg)
	defer ragAgent.Close()

	fmt.Println(" Connecting to Ollama...")
	if err := ragAgent.CheckHealth(ctx); err != nil {
		return fmt.Errorf("failed to connect to Ollama: %w", err)
	}

	fmt.Printf(" Indexing repository: %s\n", repoPath)
	err := ragAgent.IndexRepository(ctx, repoPath, nil)
	if err != nil {
		return fmt.Errorf("indexing failed: %w", err)
	}

	fmt.Printf("\n Searching for: %s\n", query)
	fmt.Println("")

	results, err := ragAgent.GetRetrievedChunks(ctx, query, topK)
	if err != nil {
		return fmt.Errorf("search failed: %w", err)
	}

	for i, result := range results {
		chunk := result.Chunk
		fmt.Printf("\n Result %d (score: %.4f)\n", i+1, result.Score)
		fmt.Printf("   File: %s:%d-%d\n", chunk.FilePath, chunk.StartLine, chunk.EndLine)
		fmt.Printf("   Type: %s", chunk.ChunkType)
		if chunk.Name != "" && chunk.Name != chunk.FilePath {
			fmt.Printf(" | Name: %s", chunk.Name)
		}
		fmt.Println()

		// Show preview (first 3 lines)
		lines := strings.Split(chunk.Content, "\n")
		preview := lines
		if len(lines) > 5 {
			preview = lines[:5]
		}
		for _, line := range preview {
			fmt.Printf("    %s\n", line)
		}
		if len(lines) > 5 {
			fmt.Printf("    ... (%d more lines)\n", len(lines)-5)
		}
	}

	return nil
}

