func (b *BM25) tokenize(text string) []string {
	text = strings.ToLower(text)

	// Extract identifiers
	matches := b.tokenRegex.FindAllString(text, -1)

	// Also split camelCase and snake_case
	var tokens []string
	for _, match := range matches {
		// Split camelCase
		camelTokens := splitCamelCase(match)
		for _, t := range camelTokens {
			t = strings.ToLower(t)
			if len(t) > 1 { // Skip single characters
				tokens = append(tokens, t)
			}
		}
	}

	return tokens
}

func runRAGChat(repoPath string) error {
	ctx, cancel := context.WithCancel(context.Background())
	defer cancel()

	// Handle interrupt signal
	sigCh := make(chan os.Signal, 1)
	signal.Notify(sigCh, syscall.SIGINT, syscall.SIGTERM)
	go func() {
		<-sigCh
		fmt.Println("\n\n Goodbye!")
		cancel()
		os.Exit(0)
	}()

	// Create RAG agent
	ragAgent := agent.NewRAGAgent(cfg)
	defer ragAgent.Close()

	// Check LLM health
	fmt.Println(" Connecting to Ollama...")
	if err := ragAgent.CheckHealth(ctx); err != nil {
		return fmt.Errorf("failed to connect to Ollama: %w\n\nMake sure Ollama is running:\n  ollama serve\n  ollama pull qwen2.5:7b\n  ollama pull nomic-embed-text", err)
	}
	fmt.Println(" Connected to Ollama")

	// Index repository
	fmt.Printf("\n Indexing repository: %s\n", repoPath)
	err := ragAgent.IndexRepository(ctx, repoPath, func(stage string, current, total int) {
		switch stage {
		case "parsing":
			fmt.Print("   Parsing code files...")
		case "embedding":
			if current > 0 && current%10 == 0 {
				fmt.Printf("\r   Generating embeddings: %d/%d", current, total)
			}
		}
	})
	if err != nil {
		return fmt.Errorf("\nindexing failed: %w", err)
	}
	fmt.Printf("\n Indexed %d code chunks\n", ragAgent.GetChunkCount())

	// Start chat
	fmt.Println("\n CodeMentor RAG Chat")
	fmt.Println("")
	fmt.Println("Ask questions about the codebase. Type 'exit' to quit, 'clear' to reset.")

	scanner := bufio.NewScanner(os.Stdin)
	for {
		fmt.Print("\n You: ")
		if !scanner.Scan() {
			break
		}

		input := strings.TrimSpace(scanner.Text())
		if input == "" {
			continue
		}

		switch strings.ToLower(input) {
		case "exit", "quit":
			fmt.Println("\n Goodbye!")
			return nil
		case "clear":
			ragAgent.ClearHistory()
			fmt.Println("  Conversation cleared.")
			continue
		case "help":
			printRAGHelp()
			continue
		}

		fmt.Print("\n CodeMentor: ")
		err := ragAgent.AskStream(ctx, input, func(content string, done bool) error {
			fmt.Print(content)
			return nil
		})

		if err != nil {
			fmt.Printf("\n Error: %v\n", err)
			continue
		}
		fmt.Println()
	}

	return scanner.Err()
}

