type VectorStore interface {
	// Insert adds embedded chunks to the store
	Insert(chunks []*embedding.EmbeddedChunk) error

	// Search finds similar chunks to the query embedding
	Search(queryEmbedding []float32, topK int) ([]*SearchResult, error)

	// Delete removes chunks by IDs
	Delete(ids []string) error

	// Clear removes all data
	Clear() error

	// Count returns the number of stored chunks
	Count() int

	// Close closes the store connection
	Close() error
}

func (e *Embedder) EmbedChunks(ctx context.Context, chunks []*indexer.CodeChunk, progressFn func(current, total int)) ([]*EmbeddedChunk, error) {
	var results []*EmbeddedChunk
	var mu sync.Mutex
	var wg sync.WaitGroup

	// Create a semaphore for concurrency control
	sem := make(chan struct{}, e.concurrency)

	// Track errors
	var failedCount int
	var errMu sync.Mutex

	total := len(chunks)

	for i, chunk := range chunks {
		wg.Add(1)
		go func(idx int, c *indexer.CodeChunk) {
			defer wg.Done()
			sem <- struct{}{}
			defer func() { <-sem }()

			// Create embedding text from chunk
			text := e.createEmbeddingText(c)

			// Generate embedding with retry
			var embedding []float32
			var err error

			for retry := 0; retry < e.maxRetries; retry++ {
				embedding, err = e.client.Embed(ctx, text)
				if err == nil {
					break
				}
				// Wait before retry
				if retry < e.maxRetries-1 {
					time.Sleep(time.Duration(retry+1) * 500 * time.Millisecond)
				}
			}

			if err != nil {
				errMu.Lock()
				failedCount++
				errMu.Unlock()
				return
			}

			mu.Lock()
			results = append(results, &EmbeddedChunk{
				Chunk:     c,
				Embedding: embedding,
			})

			// Report progress
			if progressFn != nil {
				progressFn(len(results), total)
			}
			mu.Unlock()
		}(i, chunk)
	}

	wg.Wait()

	//  80% 
	successRate := float64(len(results)) / float64(total)
	if successRate < 0.5 {
		return results, fmt.Errorf("too many failures: only %d/%d chunks embedded (%.0f%%)", len(results), total, successRate*100)
	}

	if failedCount > 0 {
		fmt.Printf("\n  Warning: %d chunks failed to embed, continuing with %d chunks\n", failedCount, len(results))
	}

	return results, nil
}

func (bm *BM25) score(queryTokens []string, docIdx int) float64 {
	var score float64

	docLen := float64(bm.docLengths[docIdx])
	tf := bm.termFreqs[docIdx]

	for _, term := range queryTokens {
		termFreq, exists := tf[term]
		if !exists {
			continue
		}

		docFreq := bm.docFreqs[term]
		if docFreq == 0 {
			continue
		}

		// IDF component
		idf := math.Log((float64(bm.totalDocs)-float64(docFreq)+0.5)/(float64(docFreq)+0.5) + 1)

		// TF component with length normalization
		tfNorm := (float64(termFreq) * (bm.k1 + 1)) /
			(float64(termFreq) + bm.k1*(1-bm.b+bm.b*docLen/bm.avgDocLen))

		score += idf * tfNorm
	}

	return score
}

func (s *Server) handleChat(c *gin.Context) {
	var req ChatRequest
	if err := c.ShouldBindJSON(&req); err != nil {
		c.JSON(http.StatusBadRequest, gin.H{"error": err.Error()})
		return
	}

	s.mu.RLock()
	session, exists := s.sessions[req.SessionID]
	s.mu.RUnlock()

	if !exists {
		c.JSON(http.StatusNotFound, gin.H{"error": "Session not found"})
		return
	}

	ctx := c.Request.Context()

	response, err := session.Agent.Ask(ctx, req.Message)
	if err != nil {
		c.JSON(http.StatusInternalServerError, gin.H{"error": err.Error()})
		return
	}

	// Update last used
	s.mu.Lock()
	session.LastUsed = time.Now()
	s.mu.Unlock()

	c.JSON(http.StatusOK, gin.H{
		"response": response,
	})
}

