func (m *MemoryStore) Search(queryEmbedding []float32, topK int) ([]*SearchResult, error) {
	m.mu.RLock()
	defer m.mu.RUnlock()

	if len(m.chunks) == 0 {
		return nil, nil
	}

	// Calculate similarity for all chunks
	type scoredChunk struct {
		chunk *indexer.CodeChunk
		score float32
	}

	var scored []scoredChunk
	for _, embeddedChunk := range m.chunks {
		score := cosineSimilarity(queryEmbedding, embeddedChunk.Embedding)
		scored = append(scored, scoredChunk{
			chunk: embeddedChunk.Chunk,
			score: score,
		})
	}

	// Sort by score descending
	sort.Slice(scored, func(i, j int) bool {
		return scored[i].score > scored[j].score
	})

	// Take top K
	if topK > len(scored) {
		topK = len(scored)
	}

	results := make([]*SearchResult, topK)
	for i := 0; i < topK; i++ {
		results[i] = &SearchResult{
			Chunk:    scored[i].chunk,
			Score:    scored[i].score,
			Distance: 1 - scored[i].score, // Convert similarity to distance
		}
	}

	return results, nil
}

func runIndex(path, url string) error {
	if url != "" {
		fmt.Println("  Remote repository indexing coming soon")
		fmt.Println("   Please clone the repository and use --path instead")
		return nil
	}

	ctx := context.Background()

	// First, just parse and show stats
	fmt.Printf(" Analyzing repository: %s\n", path)

	idx := indexer.NewIndexer(cfg.Indexer)
	result, err := idx.IndexRepository(path)
	if err != nil {
		return fmt.Errorf("analysis failed: %w", err)
	}

	indexer.PrintStats(result)

	// Now create embeddings
	fmt.Println("\n Generating embeddings...")
	fmt.Println("   (This requires Ollama with nomic-embed-text model)")

	ragAgent := agent.NewRAGAgent(cfg)
	defer ragAgent.Close()

	if err := ragAgent.CheckHealth(ctx); err != nil {
		fmt.Printf("\n  Ollama not available: %v\n", err)
		fmt.Println("   Embeddings will be generated when you run 'chat' or 'ask'")
		return nil
	}

	err = ragAgent.IndexRepository(ctx, path, func(stage string, current, total int) {
		if stage == "embedding" && current > 0 {
			fmt.Printf("\r   Progress: %d/%d chunks", current, total)
		}
	})

	if err != nil {
		return fmt.Errorf("\nembedding failed: %w", err)
	}

	fmt.Printf("\n\n Indexing complete! %d chunks embedded and ready.\n", ragAgent.GetChunkCount())
	fmt.Println("\n Next steps:")
	fmt.Println("   codementor ask --path . \"What does main.go do?\"")
	fmt.Println("   codementor chat --path .")

	return nil
}

func (h *HybridRetriever) Index(ctx context.Context, chunks []*indexer.CodeChunk, progressFn func(current, total int)) error {
	// Build BM25 index (fast, no network calls)
	h.bm25.Index(chunks)

	// Generate embeddings and store (slow, requires LLM)
	embeddedChunks, err := h.embedder.EmbedChunks(ctx, chunks, progressFn)
	if err != nil {
		return err
	}

	return h.vectorStore.Insert(embeddedChunks)
}

