func (h *HybridRetriever) mergeResults(vectorResults, bm25Results []*SearchResult, topK int) []*SearchResult {
	const k = 60.0 // RRF constant

	// Create a map to store combined scores
	scoreMap := make(map[string]float32)
	chunkMap := make(map[string]*indexer.CodeChunk)

	// Add vector results with RRF scores
	for rank, result := range vectorResults {
		id := result.Chunk.ID
		score := h.vectorWeight * float32(1.0/(k+float64(rank+1)))
		scoreMap[id] += score
		chunkMap[id] = result.Chunk
	}

	// Add BM25 results with RRF scores
	for rank, result := range bm25Results {
		id := result.Chunk.ID
		score := h.bm25Weight * float32(1.0/(k+float64(rank+1)))
		scoreMap[id] += score
		if _, exists := chunkMap[id]; !exists {
			chunkMap[id] = result.Chunk
		}
	}

	// Convert to slice and sort
	type scored struct {
		id    string
		score float32
	}

	var scores []scored
	for id, score := range scoreMap {
		scores = append(scores, scored{id: id, score: score})
	}

	sort.Slice(scores, func(i, j int) bool {
		return scores[i].score > scores[j].score
	})

	// Take top K
	if topK > len(scores) {
		topK = len(scores)
	}

	results := make([]*SearchResult, topK)
	for i := 0; i < topK; i++ {
		results[i] = &SearchResult{
			Chunk: chunkMap[scores[i].id],
			Score: scores[i].score,
		}
	}

	return results
}

func (idx *Indexer) IndexRepository(repoPath string) (*IndexResult, error) {
	startTime := time.Now()

	// Resolve absolute path
	absPath, err := filepath.Abs(repoPath)
	if err != nil {
		return nil, fmt.Errorf("failed to resolve path: %w", err)
	}

	// Check if path exists
	info, err := os.Stat(absPath)
	if err != nil {
		return nil, fmt.Errorf("path does not exist: %w", err)
	}
	if !info.IsDir() {
		return nil, fmt.Errorf("path is not a directory: %s", absPath)
	}

	// Scan for source files
	files, err := idx.scanner.Scan(absPath)
	if err != nil {
		return nil, fmt.Errorf("failed to scan directory: %w", err)
	}

	if len(files) == 0 {
		return nil, fmt.Errorf("no source files found in %s", absPath)
	}

	// Process files concurrently
	var allChunks []*CodeChunk
	var errors []string
	var mu sync.Mutex
	var wg sync.WaitGroup

	// Use a semaphore to limit concurrency
	sem := make(chan struct{}, 10)

	for _, file := range files {
		wg.Add(1)
		go func(f *FileInfo) {
			defer wg.Done()
			sem <- struct{}{}
			defer func() { <-sem }()

			chunks, err := idx.parseFile(f)
			mu.Lock()
			defer mu.Unlock()

			if err != nil {
				errors = append(errors, fmt.Sprintf("%s: %v", f.RelPath, err))
				return
			}
			allChunks = append(allChunks, chunks...)
		}(file)
	}

	wg.Wait()

	// Collect language statistics
	langMap := make(map[string]bool)
	for _, chunk := range allChunks {
		langMap[chunk.Language] = true
	}
	var languages []string
	for lang := range langMap {
		languages = append(languages, lang)
	}

	// Create repository info
	repo := &Repository{
		Path:        absPath,
		Name:        filepath.Base(absPath),
		Languages:   languages,
		TotalFiles:  len(files),
		TotalChunks: len(allChunks),
		IndexedAt:   time.Now().Format(time.RFC3339),
	}

	result := &IndexResult{
		Repository:  repo,
		Chunks:      allChunks,
		Errors:      errors,
		ElapsedTime: time.Since(startTime).String(),
	}

	return result, nil
}

