func (a *RAGAgent) IndexRepository(ctx context.Context, repoPath string, progressFn func(stage string, current, total int)) error {
	// Stage 1: Parse code files
	if progressFn != nil {
		progressFn("parsing", 0, 0)
	}

	result, err := a.indexer.IndexRepository(repoPath)
	if err != nil {
		return fmt.Errorf("failed to parse repository: %w", err)
	}

	a.repoName = result.Repository.Name

	// Stage 2: Generate embeddings and index
	if progressFn != nil {
		progressFn("embedding", 0, len(result.Chunks))
	}

	err = a.retriever.Index(ctx, result.Chunks, func(current, total int) {
		if progressFn != nil {
			progressFn("embedding", current, total)
		}
	})

	if err != nil {
		return fmt.Errorf("failed to index: %w", err)
	}

	return nil
}

func (b *BM25) Search(query string, topK int) []*SearchResult {
	if b.totalDocs == 0 {
		return nil
	}

	queryTokens := b.tokenize(query)
	if len(queryTokens) == 0 {
		return nil
	}

	// Calculate BM25 scores
	type scored struct {
		idx   int
		score float64
	}

	var scores []scored
	for i := range b.chunks {
		score := b.score(queryTokens, i)
		if score > 0 {
			scores = append(scores, scored{idx: i, score: score})
		}
	}

	// Sort by score descending
	sort.Slice(scores, func(i, j int) bool {
		return scores[i].score > scores[j].score
	})

	// Take top K
	if topK > len(scores) {
		topK = len(scores)
	}

	results := make([]*SearchResult, topK)
	for i := 0; i < topK; i++ {
		results[i] = &SearchResult{
			Chunk: b.chunks[scores[i].idx],
			Score: float32(scores[i].score),
		}
	}

	return results
}

func (c *Client) Chat(ctx context.Context, messages []Message) (string, error) {
	req := ChatRequest{
		Model:    c.chatModel,
		Messages: messages,
		Stream:   false,
	}

	body, err := json.Marshal(req)
	if err != nil {
		return "", fmt.Errorf("failed to marshal request: %w", err)
	}

	httpReq, err := http.NewRequestWithContext(ctx, "POST", c.host+"/api/chat", bytes.NewReader(body))
	if err != nil {
		return "", fmt.Errorf("failed to create request: %w", err)
	}
	httpReq.Header.Set("Content-Type", "application/json")

	resp, err := c.httpClient.Do(httpReq)
	if err != nil {
		return "", fmt.Errorf("failed to send request: %w", err)
	}
	defer resp.Body.Close()

	if resp.StatusCode != http.StatusOK {
		bodyBytes, _ := io.ReadAll(resp.Body)
		return "", fmt.Errorf("ollama returned status %d: %s", resp.StatusCode, string(bodyBytes))
	}

	var chatResp ChatResponse
	if err := json.NewDecoder(resp.Body).Decode(&chatResp); err != nil {
		return "", fmt.Errorf("failed to decode response: %w", err)
	}

	return chatResp.Message.Content, nil
}

