func (p *GoParser) fallbackParse(fileInfo *FileInfo, content []byte) ([]*CodeChunk, error) {
	chunk := &CodeChunk{
		FilePath:  fileInfo.RelPath,
		Language:  "go",
		ChunkType: ChunkTypeFile,
		Name:      fileInfo.RelPath,
		Content:   string(content),
		StartLine: 1,
		EndLine:   strings.Count(string(content), "\n") + 1,
	}
	chunk.ID = generateChunkID(chunk)

	return []*CodeChunk{chunk}, nil
}

func (p *GoParser) parseTypeSpec(spec *ast.TypeSpec, decl *ast.GenDecl, fset *token.FileSet, lines []string, filePath string) *CodeChunk {
	startLine := fset.Position(decl.Pos()).Line
	endLine := fset.Position(decl.End()).Line

	var chunkType ChunkType
	var signature string

	switch t := spec.Type.(type) {
	case *ast.StructType:
		chunkType = ChunkTypeStruct
		signature = fmt.Sprintf("type %s struct", spec.Name.Name)
		// Include field count in metadata
		if t.Fields != nil {
			signature = fmt.Sprintf("type %s struct { %d fields }", spec.Name.Name, len(t.Fields.List))
		}

	case *ast.InterfaceType:
		chunkType = ChunkTypeInterface
		signature = fmt.Sprintf("type %s interface", spec.Name.Name)
		if t.Methods != nil {
			signature = fmt.Sprintf("type %s interface { %d methods }", spec.Name.Name, len(t.Methods.List))
		}

	default:
		// Type alias or other type definitions
		chunkType = ChunkTypeGeneric
		signature = fmt.Sprintf("type %s", spec.Name.Name)
	}

	// Extract doc comment
	var docComment string
	if decl.Doc != nil {
		docComment = decl.Doc.Text()
	} else if spec.Doc != nil {
		docComment = spec.Doc.Text()
	}

	content := extractLines(lines, startLine, endLine)

	chunk := &CodeChunk{
		FilePath:   filePath,
		Language:   "go",
		ChunkType:  chunkType,
		Name:       spec.Name.Name,
		Signature:  signature,
		Content:    content,
		StartLine:  startLine,
		EndLine:    endLine,
		DocComment: strings.TrimSpace(docComment),
	}
	chunk.ID = generateChunkID(chunk)

	return chunk
}

func (c *Chunker) ChunkFile(fileInfo *FileInfo) ([]*CodeChunk, error) {
	content, err := os.ReadFile(fileInfo.Path)
	if err != nil {
		return nil, err
	}

	text := string(content)
	language := GetLanguage(fileInfo.Extension)

	// If file is small enough, return as single chunk
	if len(text) <= c.chunkSize {
		chunk := &CodeChunk{
			FilePath:  fileInfo.RelPath,
			Language:  language,
			ChunkType: ChunkTypeFile,
			Name:      fileInfo.RelPath,
			Content:   text,
			StartLine: 1,
			EndLine:   strings.Count(text, "\n") + 1,
		}
		chunk.ID = generateChunkID(chunk)
		return []*CodeChunk{chunk}, nil
	}

	// Split into chunks with overlap
	return c.chunkText(text, fileInfo.RelPath, language)
}

type IndexResult struct {
	Repository  *Repository  `json:"repository"`
	Chunks      []*CodeChunk `json:"chunks"`
	Errors      []string     `json:"errors,omitempty"`
	ElapsedTime string       `json:"elapsed_time"`
}

func (s *Server) handleSearch(c *gin.Context) {
	var req SearchRequest
	if err := c.ShouldBindJSON(&req); err != nil {
		c.JSON(http.StatusBadRequest, gin.H{"error": err.Error()})
		return
	}

	if req.TopK <= 0 {
		req.TopK = 5
	}

	s.mu.RLock()
	session, exists := s.sessions[req.SessionID]
	s.mu.RUnlock()

	if !exists {
		c.JSON(http.StatusNotFound, gin.H{"error": "Session not found"})
		return
	}

	ctx := c.Request.Context()

	results, err := session.Agent.GetRetrievedChunks(ctx, req.Query, req.TopK)
	if err != nil {
		c.JSON(http.StatusInternalServerError, gin.H{"error": err.Error()})
		return
	}

	// Format results
	var formattedResults []gin.H
	for _, r := range results {
		formattedResults = append(formattedResults, gin.H{
			"file_path":   r.Chunk.FilePath,
			"start_line":  r.Chunk.StartLine,
			"end_line":    r.Chunk.EndLine,
			"chunk_type":  r.Chunk.ChunkType,
			"name":        r.Chunk.Name,
			"signature":   r.Chunk.Signature,
			"content":     r.Chunk.Content,
			"score":       r.Score,
		})
	}

	c.JSON(http.StatusOK, gin.H{
		"query":   req.Query,
		"results": formattedResults,
	})
}

func formatFieldList(fl *ast.FieldList) string {
	var parts []string

	for _, field := range fl.List {
		typeName := exprToString(field.Type)

		if len(field.Names) == 0 {
			parts = append(parts, typeName)
		} else {
			for _, name := range field.Names {
				parts = append(parts, fmt.Sprintf("%s %s", name.Name, typeName))
			}
		}
	}

	return strings.Join(parts, ", ")
}

func (s *Server) Run() error {
	addr := fmt.Sprintf("%s:%d", s.config.Server.Host, s.config.Server.Port)
	fmt.Printf(" Starting CodeMentor API server on %s\n", addr)
	return s.router.Run(addr)
}

func extractLines(lines []string, start, end int) string {
	if start < 1 {
		start = 1
	}
	if end > len(lines) {
		end = len(lines)
	}
	if start > end || start > len(lines) {
		return ""
	}

	return strings.Join(lines[start-1:end], "\n")
}

type FileInfo struct {
	Path      string
	RelPath   string // Relative path from repo root
	Extension string
	Size      int64
}

func (m *MemoryStore) save() error {
	// Ensure directory exists
	dir := filepath.Dir(m.dataPath)
	if err := os.MkdirAll(dir, 0755); err != nil {
		return fmt.Errorf("failed to create directory: %w", err)
	}

	// Convert to slice for JSON
	var chunks []*embedding.EmbeddedChunk
	for _, chunk := range m.chunks {
		chunks = append(chunks, chunk)
	}

	data, err := json.Marshal(chunks)
	if err != nil {
		return fmt.Errorf("failed to marshal data: %w", err)
	}

	if err := os.WriteFile(m.dataPath, data, 0644); err != nil {
		return fmt.Errorf("failed to write file: %w", err)
	}

	return nil
}

func (s *Server) handleDeleteSession(c *gin.Context) {
	sessionID := c.Param("id")

	s.mu.Lock()
	session, exists := s.sessions[sessionID]
	if exists {
		session.Agent.Close()
		delete(s.sessions, sessionID)
	}
	s.mu.Unlock()

	if !exists {
		c.JSON(http.StatusNotFound, gin.H{"error": "Session not found"})
		return
	}

	c.JSON(http.StatusOK, gin.H{"message": "Session deleted"})
}

type MemoryStore struct {
	mu       sync.RWMutex
	chunks   map[string]*embedding.EmbeddedChunk
	dataPath string
}

func PrintStats(result *IndexResult) {
	stats := GetStats(result)

	fmt.Printf("\n Indexing Statistics\n")
	fmt.Printf("\n")
	fmt.Printf("   Repository: %s\n", result.Repository.Name)
	fmt.Printf("   Total Files: %d\n", stats.TotalFiles)
	fmt.Printf("   Total Chunks: %d\n", stats.TotalChunks)
	fmt.Printf("   Avg Chunks/File: %.1f\n", stats.AverageChunks)
	fmt.Printf("   Time Elapsed: %s\n", result.ElapsedTime)

	fmt.Printf("\n Chunks by Type:\n")
	for chunkType, count := range stats.ChunksByType {
		fmt.Printf("    %s: %d\n", chunkType, count)
	}

	fmt.Printf("\n Chunks by Language:\n")
	for lang, count := range stats.ChunksByLang {
		fmt.Printf("    %s: %d\n", lang, count)
	}

	if len(result.Errors) > 0 {
		fmt.Printf("\n  Errors (%d):\n", len(result.Errors))
		for _, err := range result.Errors {
			fmt.Printf("    %s\n", err)
		}
	}
}

func (m *MemoryStore) Delete(ids []string) error {
	m.mu.Lock()
	defer m.mu.Unlock()

	for _, id := range ids {
		delete(m.chunks, id)
	}

	if m.dataPath != "" {
		return m.save()
	}

	return nil
}

func (a *RAGAgent) Ask(ctx context.Context, question string) (string, error) {
	// Retrieve relevant code chunks
	results, err := a.retriever.Search(ctx, question, 5)
	if err != nil {
		return "", fmt.Errorf("retrieval failed: %w", err)
	}

	// Build context from retrieved chunks
	context := a.buildContext(results)

	// Build prompt with context
	prompt := a.buildPrompt(question, context)

	// Add to history
	a.history = append(a.history, llm.Message{
		Role:    "user",
		Content: prompt,
	})

	// Generate response
	response, err := a.llmClient.Chat(ctx, a.getMessagesWithSystem())
	if err != nil {
		// Remove failed message from history
		a.history = a.history[:len(a.history)-1]
		return "", fmt.Errorf("generation failed: %w", err)
	}

	// Add response to history
	a.history = append(a.history, llm.Message{
		Role:    "assistant",
		Content: response,
	})

	return response, nil
}

